ウォーターライン整備をする方に朗報！<br>複雑化したエンジンルーム、車体の入り込んだところにあるホースクリップも、AE92の後継機として発売された「ホースクリッププライヤAE931」なら、作業がしやくなります。<br>AE931は支点で大きく開くので、片手で操作でき、作業性に優れています。<br>山形のエッジを碁盤目状に配してある台形形状の歯部で、ホースクリップをしっかりキャッチ！<br>樹脂カバーがないタイプに仕上げたグリップには、すべり止めの加工を施してあり、狭い場所にも手を差し込めます。<br>スプリング式ホースクリップの脱着作業に最適！<br><br><img src="http://image.rakuten.co.jp/ainekusu/cabinet/kougu2/imgrc0068725518.jpg"><br><br>適用/ホース外径Φ10～47mmに使用される板バネ式のホースクリップ型式：AE931<br>メーカー/KTC(京都機械工具株式会社)
